settings.cardCss:
/* Table container */
.table-container {
  max-width: 600px;
  margin: 20px auto;
  text-align: center;
  font-family: Arial, sans-serif;
}

/* Table styling */
.failure-history-table {
  width: 100%;
  border-collapse: collapse;
  margin-top: 10px;
}

/* Table header */
.failure-history-table thead th {
  background-color: #333;
  color: #fff;
  padding: 10px;
  text-transform: uppercase;
  font-weight: bold;
}

/* Table rows */
.failure-history-table tbody td {
  padding: 8px;
  border-bottom: 1px solid #ddd;
}

/* Row color based on status */
.failure-history-table tbody tr:nth-child(even) {
  background-color: #f9f9f9;
}

/* Status-based color coding */
.failure-history-table tbody td:nth-child(3) {
  font-weight: bold;
}

/* Status color coding for Up, Down, and Maintenance */
.failure-history-table tbody td:nth-child(3)[data-status="Up"] {
  color: #4caf50; /* Green for Up */
}

.failure-history-table tbody td:nth-child(3)[data-status="Down"] {
  color: #ff4c4c; /* Red for Down */
}

.failure-history-table tbody td:nth-child(3)[data-status="Maintenance"] {
  color: #ff9800; /* Yellow for Maintenance */
}

